import styles from './List.module.css'
import { useDispatch, useSelector } from 'react-redux';
import { selectPurposes } from '../../../redux/plan-selectors';
import { purposeType } from '../types/types';
import {actions} from '../../../redux/plan-reducer';
import TodoItem from './TodoItem.tsx';

const ListOfTodos = ({todos}) => {
    //const list = useSelector(selectPurposes)
    //const deletePurpose = (purpose) => {
    //    dispatch(actions.deletePurpose(purpose))
    //}
    return (
        <>
            {todos.length > 0 && 
            <div className={styles.listOfWork}>
                {todos.map((todo) => <TodoItem todo={todo} />)}
            </div>}
        </>
    )
}

export default ListOfTodos
